var title_f42_40_43658="Pathologic skin picking";
var content_f42_40_43658=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F60854%7EDERM%2F72635%7EDERM%2F53693%7EDERM%2F61686%7EDERM%2F66802%7EDERM%2F55043%7EDERM%2F82620&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F60854%7EDERM%2F72635%7EDERM%2F53693%7EDERM%2F61686%7EDERM%2F66802%7EDERM%2F55043%7EDERM%2F82620&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acne excori&eacute;e",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Excoriated papules with erosions and multiple hyperpigmented macules in a 25-year-old young woman who had developed acne papules a few years before. Chronic picking of papules resulted in erosions, scarring, and postinflammatory hyperpigmentation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; Shahbaz A Janjua, MD, Dermatlas; file://www.dermatlas.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acne excori&eacute;e",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This 13-year-old girl picked the comedones on her forehead, resulting in chronic erosions. Some of the erosions healed with scarring as new lesions appeared.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; Bernard Cohen, MD, Dermatlas; file://www.dermatlas.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pathologic skin picking",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Angulated, linear, and sharply demarcated erosions, ulcerations, and purpuric patches on the abdomen of a healthy 15-year-old girl with a history of acute anxiety. The eruption cleared completely following mental health counseling.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; Bernard Cohen, MD, Dermatlas; file://www.dermatlas.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Psychogenic excoriation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 251px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sharply demarcated erosions, ulcerations, and purpuric patches in a 15-year-old girl with anxiety disorder. Lesions were restricted to areas she could reach and healed completely after a week of occlusive dressing. All lesions cleared following mental health counseling.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; Bernard Cohen, MD, Dermatlas; file://www.dermatlas.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 488px\">",
"   <div class=\"ttl\">",
"    Psychogenic excoriations of the face",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 468px; height: 296px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Excoriations and sharply demarcated superficial ulcerations on the face of a woman with pathologic skin picking.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Psychogenic excoriations",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Excoriated and lichenified lesions with postinflammatory hyperpigmentation. Note the relative sparing of the less accessible scapular areas in typical \"butterfly distribution\".",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 483px\">",
"   <div class=\"ttl\">",
"    Acne excori&eacute;e",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 463px; height: 531px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Multiple small excoriated lesions on the face of a thirty-year-old woman who cleared completely after treatment with fluoxetine, a selective serotonin reuptake inhibitor.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
