var title_f42_40_43660="X-linked adrenoleukodystrophy B";
var content_f42_40_43660=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F80404&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F80404&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    X-linked adrenoleukodystrophy (X-ALD) phenotypes, continued",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Phenotypes",
"       </td>",
"       <td class=\"subtitle1\">",
"        Total ALD, percent",
"       </td>",
"       <td class=\"subtitle1\">",
"        Symptoms/ signs",
"       </td>",
"       <td class=\"subtitle1\">",
"        Age at present- ation, y",
"       </td>",
"       <td class=\"subtitle1\">",
"        Mis- diagnosed as",
"       </td>",
"       <td class=\"subtitle1\">",
"        Diag- nostic test",
"       </td>",
"       <td class=\"subtitle1\">",
"        Follow-up tests",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recom- mended therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"8\" rowspan=\"1\">",
"        Males, continued",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pure AMN&bull;",
"       </td>",
"       <td>",
"        35",
"       </td>",
"       <td>",
"        Paraparesis, sphincter disturbances, sensory changes, incoordination, pain, impotence",
"       </td>",
"       <td>",
"        28 (SD,9)",
"       </td>",
"       <td>",
"        Multiple sclerosis, progressive spastic paraparesis, cervical spondylosis, osteoarthritis, back injury, ALS, \"triple A syndrome\"",
"       </td>",
"       <td>",
"        <p>",
"         VLCFA",
"        </p>",
"        <p>",
"         Confirm with DNA",
"        </p>",
"       </td>",
"       <td>",
"        Brain MRI, adrenal function, MTS, SSEP, family screening",
"       </td>",
"       <td>",
"        Adrenal HRT if indicated, possibly Lorenzo's oil,&Delta; physical therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cerebral AMN&bull;",
"       </td>",
"       <td>",
"        15 (increases with age)",
"       </td>",
"       <td>",
"        Like pure AMN plus dementia, behavioral disturbances, psychosis, epilepsy, aphasia, visual loss, bulbar palsy",
"       </td>",
"       <td>",
"        28 (SD, 9)",
"       </td>",
"       <td>",
"        Other causes, dementia, other neuro- degenerative diseases, brain tumor, schizophrenia, Alzheimer disease, cerebro- vascular disease, epilepsy, alcoholism, drug dependency",
"       </td>",
"       <td>",
"        <p>",
"         VLCFA, brain MRI",
"        </p>",
"        <p>",
"         Confirm with DNA",
"        </p>",
"       </td>",
"       <td>",
"        As in pure AMN plus neurological and neuro- psychological testing, EEG, psychiatry, family screening",
"       </td>",
"       <td>",
"        Adrenal HRT if indicated, general support, possibly HSCT&loz;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cerebellar",
"       </td>",
"       <td>",
"        2-3",
"       </td>",
"       <td>",
"        Ataxia, brainstem",
"       </td>",
"       <td>",
"        Child- hood; adole- scence",
"       </td>",
"       <td>",
"        Olivoponto- cerebellar degeneration",
"       </td>",
"       <td>",
"        <p>",
"         VLCFA, brain MRI",
"        </p>",
"        <p>",
"         Confirm with DNA",
"        </p>",
"       </td>",
"       <td>",
"        Adrenal function, neurological testing, family screening",
"       </td>",
"       <td>",
"        Adrenal HRT if indicated, physical therapy",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Percentages listed above vary by age group, as the asymptomatic and Addison disease groups decline with age while the ALD and AMN groups increase.",
"    <div class=\"footnotes\">",
"     ADHD: attention-deficit/hyperactivity disorder; ALS: amyotrophic lateral sclerosis; DNA: ABCD1 mutation analysis; AMN: adrenomyeloneuropathy; EEG: electroencephalogram; HRT: hormone replacement therapy; HSCT: hematopoietic stem cell transplant; MRI: magnetic resonance imaging; MTS: magnetization transfer MRI cervical cord; SSEP: somatosensory evoked potential; VLCFA: very long chain fatty acids assay in plasma.",
"     <br>",
"      &bull; See text for distinction between pure and cerebral AMN.",
"      <br>",
"       &Delta; Placebo-controlled trial in progress.",
"       <br>",
"        &loz; HSCT being considered for mild cerebral AMN.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Moser HW, Raymond GV, Dubey P. Adrenoleukodustrophy: new approaches to a Neurodegenerative Disease. JAMA 2005; 294:3131. Copyright &copy; 2005 American Medical Association. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
